  The Freedom of Information Act (FOIA) is a federal law that allows for the full or partial disclosure of previously unreleased information and documents controlled by the United States Government. The Act defines agency records subject to disclosure, outlines mandatory disclosure procedures and grants nine exemptions to the statute.[1] It was signed into law by President Lyndon B. Johnson on July 4, 1966 (Public Law 89-554, 80 Stat. 383; Amended 1996, 2002, 2007), and went into effect the following year.

